import React from 'react';
import { Link} from 'react-router-dom';
import * as FaIcons from 'react-icons/fa';
import './Sidebar.css';


function Sidebar() {
    return (
        <>
            <div class="sidebar">
                <Link to="#" className="sidebar-bars">
                    <FaIcons.FaBars />
                </Link>
            </div>
        </>
    )
}

export default Sidebar
